@ZOLERAH Johnny's cheeks didn't take long to follow, turning a shade of pink in response to being called such a thing. Trying to cover it up however, he cleared his throat and removed his sunglasses.

Despite his efforts, it was difficult not to look into those eyes.

—

@xpaulorochax Se nao me engano essa frase é do Marx.

Entao o sujeito pode ser o próprio marx na historia né.

(exceto quando o marx tava dando shade pro paul lafargue e resolveu soltar que nao era marxista e piriri pororó)
